import { Grid, ListItem } from '@mui/material';
import React from 'react';

export default function ItemListContainer() {
  return (
    <>
    <Grid container spacing={2}>
      <Grid item xs={8}>
      <ListItem>
        Lorem ipsum dolor sit amet consectetur adipisicing elit. Nihil quisquam sunt voluptatibus numquam vel dolor ratione, harum doloribus nostrum exercitationem mollitia sed blanditiis veritatis est deserunt. Minima iure fugit nostrum!
      </ListItem>
      </Grid>
    </Grid>
    </>
  )
}
